        <i class="fab fa-twitter-square"></i>
        <i class="fab fa-pinterest-square"></i>
      </div>
      <div className="topCenter">
        <ul className="topList"></ul>
      </div>

      <div className="topRight">r</div>
    </div>
  );
};

export default TopBar;
